	('XJVQMrL', 'rPq89ES', 'nocommentbruh', 'Testing Time', 'A|||B|||C|||', '<h1>Â </h1><p>INSTRUCTION</p>', '3_food1.jpg', 'null', 'null', '2022-01-07 21:01:50', '2022-01-07 21:01:50', 1, 'Select a category'),
	('yT30fMk', 'kphViPE', 'nocommentbruh', 'Baked Salmon', '25 minutes|||30 minutes|||5-8 people|||To add extra flavor to the surface, broil the salmon for 3 to 4 minutes after baking. Keep a close eye on the fish after the first 2 minutes of broiling. Make sure the garlic browns but doesnâ€™t burn. This step is optional but deepens the flavor of the fish and citrus with roasted notes. If you skip broiling, add a few more minutes of bake time for medium-cooked doneness.', '<h1>Baking</h1><p>To add extra flavor to the surface, broil the salmon for 3 to 4 minutes after baking. Keep a close eye on the fish after the first 2 minutes of broiling. Make sure the garlic browns but doesnâ€™t burn. This step is optional but deepens the flavor of the fish and citrus with roasted notes. If you skip broiling, add a few more minutes of bake time for medium-cooked doneness.</p>', 'Baked-Salmon-88.jpg', 'null', 'null', '2022-01-08 09:57:19', '2022-01-08 10:52:21', 1, 'Dinner');
